//style importer
import * as s__ from "./style";
//component importer
//utils importer
//global store
////init
import {connect} from 'react-redux';
import {MainState} from './../../store/index';
//type importer
import {SignInState} from './../../store/SignInForm/type';
//action importer
import {
  setCheckTypeStatusChecker,
  setReally2CheckStatusChecker
} from './../../store/SignInForm/action';



interface Props {
}

class SignInForm extends Component<Props, {}> {

  formDisplay = () => {
  };

  formRegisterDisplay = () => {
  };

  formSignin = () => {
    return (
      <s__.Container>
          <form action="">
            <label>
              {" "}
              CMND: <input type="text" />
            </label>
            <hr />
            <label>
              Password: <input type="password" />
            </label>
            <hr />
            <s__.LinkRoute to="/register" onClick={() => this.formRegisterDisplay()}>
              Bạn chưa có tài khoản ?
            </s__.LinkRoute>
            <hr />
            <span onClick={this.formDisplay}>Cancel</span>
          </form>
      </s__.Container>
    );
  };

  render() {
    return <React.Fragment>{this.formSignin()}</React.Fragment>;
  }
}

export default SignInForm;
